import {all} from "redux-saga"
import ytSearchAsyncSaga from "./ytSearchSaga";
import calcBpmAsyncSaga from "./calcBpmSaga";
import setUserSaga from "./setUserSaga";


function* rootSaga(){
    yield all([
        ytSearchAsyncSaga(),
        calcBpmAsyncSaga(),
        setUserSaga()
    ])
}

export default rootSaga;
